import React, { Component } from 'react';
import WoodLogo from '../images/woodGroupLogo.png';
import BusinessStuds from '../images/businessStudsLogo.png';
import mobile from '../images/mobileDesign.png';
import laptop from '../images/computerDesign.png';

export class Experience extends Component {
    render() {
        return (
            <div style={main}>
                <h2 style={headingText}> Professional <br/> Experience </h2>
                <div style={experienceGrid}>
                    <img src={mobile} style={{ gridColumnStart: 5, gridRowStart: 3 }} width="400" height="400" />
                    <img src={laptop} style={{ gridColumnStart: 8, gridRowStart: 2 }} width="400" height="400" />
                </div>


            </div>

        )
    }

}

const main = {
    display: 'flex',
    height: '100vh',
    backgroundColor: "#dedede"
};

const headingText = {
    marginLeft: '20px',
    fontSize: '3rem'
}

const experienceGrid = {
    display: 'grid'
}

export default Experience;
